CREATE TABLE subscribe (
    id_komentar	VARCHAR(5),
    id_supporter VARCHAR(3),
    id_konten	VARCHAR(4),
    isi	VARCHAR(512),
    waktu	DATETIME,
    PRIMARY KEY (id_komentar),
    FOREIGN KEY (id_supporter)  REFERENCES Suporter(id_suporter),
    FOREIGN KEY (id_konten)    REFERENCES Konten(id_konten)
);

